import React from "react";
import { useFormik } from "formik";

function App() {
  const formik = useFormik({
    initialValues: {
      email: '',
      password: '',
    },
    onSubmit: values => {
      console.log('form: ', values);
    }
  });

  return (
    <div>
      <form onSubmit={formik.handleSubmit}>
        <div>Email:</div>
        <input email="email" type="text" onChange={formik.handleChange}
          value={formik.values.email}/>
        <div>Password:</div>
        <input password="password" type="text" onChange={formik.handleChange}
          value={formik.values.password}/>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default App;
